public class DeploymentConfigFactory(string resourceName = null, Action<Humidifier.CodeDeploy.DeploymentConfig> factoryAction = null) : ResourceFactory<Humidifier.CodeDeploy.DeploymentConfig>(resourceName)
{

    internal InnerDeploymentConfigZonalConfigFactory ZonalConfigFactory { get; set; }

    internal InnerDeploymentConfigTrafficRoutingConfigFactory TrafficRoutingConfigFactory { get; set; }

    internal InnerDeploymentConfigMinimumHealthyHostsFactory MinimumHealthyHostsFactory { get; set; }

    protected override Humidifier.CodeDeploy.DeploymentConfig Create()
    {
        var deploymentConfigResult = CreateDeploymentConfig();
        factoryAction?.Invoke(deploymentConfigResult);

        return deploymentConfigResult;
    }

    private Humidifier.CodeDeploy.DeploymentConfig CreateDeploymentConfig()
    {
        var deploymentConfigResult = new Humidifier.CodeDeploy.DeploymentConfig
        {
            GivenName = InputResourceName,
        };

        return deploymentConfigResult;
    }
    public override void CreateChildren(Humidifier.CodeDeploy.DeploymentConfig result)
    {
        base.CreateChildren(result);

        result.ZonalConfig ??= ZonalConfigFactory?.Build();
        result.TrafficRoutingConfig ??= TrafficRoutingConfigFactory?.Build();
        result.MinimumHealthyHosts ??= MinimumHealthyHostsFactory?.Build();
    }

} // End Of Class

